'||'We need to run the following to add the remote cluster on each node using the cluster IP we assigned earlier. '||'
'||' '||'
'||'example:'||'
'||' '||'
'||'#haclus -add  192.168.10.225'||'
'||'#hahb -add Icmp'||'
'||'#hahb -modify Icmp ClusterList  remotecluster'||'
'||'#hahb -modify Icmp Arguments  &quot;192.168.10.225&quot; -clus remotecluster'||'
'||' '||'
'||' '||'
'||' '||'
'||'11.) Make the two service gourps nbu_SG and catalogBU_SG global. '||'
'||' '||'
'||'example:'||'
'||'Execute these command on both nodes'||'
'||' '||'
'||'hagrp -modify nbu_SG ClusterList devnetbackup_sbdnd01wm144 0 devnetbackup_sbdnd01so144 1'||'
'||'hagrp -modify nbu_SG ClusterFailOverPolicy Manual'||'
'||' '||'
'||' '||'
'||'hagrp -modify catalogBU_SG ClusterList devnetbackup_sbdnd01wm144 0 devnetbackup_sbdnd01so144 1'||'
'||'hagrp -modify catalogBU_SG ClusterFailOverPolicy Manual', '0a5f3d020c555354ce0447fded3dc70a', 0, '', '1l34knee', 1, 0, '', 0, 0, 0, 1, 0, '', 0);
'||'[b:1329kfix] VVR Issues [/b:1329kfix]'||'
'||'Customer Desription:'||'
'||'
'||' After VVR replication implementation we faced problem with one out of four disk group. When replication of this disk group is completed then SRL disk starts to fill until 100% when DCM fills up too according to overflow protection strategy causing bad performance of our main application. Only after manual stopping this replication (vradmin -g mmdatadg -f stoprep mmdatadg_rvg) our application starts to work normally but losing data consistency between two locations.'||'
'||'
'||'[i:1329kfix]rv mmdatadg_rvg 1            ENABLED  ACTIVE   secondary 1        vol_slr                                           '||'
'||'rl mmdatadg_kat mmdatadg_rvg DETACHED STALE    10.1.124.171 mmdatadg mmdatadg_zel '||'
'||'v  vol01        mmdatadg_rvg ENABLED  ACTIVE   429619200 SELECT   -        fsgen'||'
'||'pl vol01-01     vol01        ENABLED  ACTIVE   429619200 CONCAT   -        RW'||'
'||'sd mmdatadgmsa2040-0_14-01 vol01-01 mmdatadgmsa2040-0_14 0 429619200 0 msa2040-0_14 ENA'||'
'||'pl vol01-02     vol01        ENABLED  ACTIVE   LOGONLY  CONCAT    -        RW'||'
'||'sd mmdatadgmsa2040-0_14-02 vol01-02 mmdatadgmsa2040-0_14 429619200 512 LOG msa2040-0_14 ENA'||'
'||'v  vol_slr      mmdatadg_rvg ENABLED  ACTIVE   209715200 SELECT   -        SRL'||'
'||'pl vol_slr-01   vol_slr      ENABLED  ACTIVE   209715200 CONCAT   -        RW'||'
'||'sd mmdatadgdisk_slr-01 vol_slr-01 mmdatadgdisk_slr 0 209715200 0  msa2040-0_19 ENA'||'
'||'
