'||'Supported Procedure to perform Linux Indexer Uprgade'||'
'||'
'||'InstallingInstalling Installing InstallingInstalling Linux indexer to run Linux indexer to run Linux indexer to run Linux indexer to run Linux indexer to run Linux indexer to run Linux indexer to run Linux indexer to run Linux indexer to run Linux indexer to run as a non non-root userroot userroot userroot userroot user root user'||'
'||'NOTE: This document refers to user “parag” as an example.'||'
'||'
'||'
'||'1. Install Symantec Data Insight Linux Indexer package as “root”.'||'
'||'
'||'2. At the time of worker node registration, don’t start services.'||'
'||'
'||'3. Issue the following commands to delete Data Insight services from startup so they will not run as root when the system reboots:'||'
'||'chkconfig --del DataInsightComm'||'
'||'chkconfig --del DataInsightConfig'||'
'||'chkconfig --del DataInsightWatchdog'||'
'||'
'||'
'||'4. Change the ownership of the Data insight binaries/data directory/logs folder to the user you would like run the services as:'||'
'||'chown -R parag:parag /var/DataInsight'||'
'||'chown -R parag:parag /DataInsight'||'
'||'chown -R parag:parag /opt/DataInsight'||'
'||'NOTE: Change paths above as per your setup.'||'
'||'5. Switch to the user using the following command:'||'
'||'su – parag'||'
'||'
'||'
'||'6. (Optional) To use an alternate location for log files, edit the following files located in /opt/DataInsight/conf directory, replacing “/var/DataInsight/log” with the new log location:'||'
'||'cli_logging.properties'||'
'||'dscli_logging.properties'||'
'||'commd_logging.properties'||'
'||'watchdog_logging.properties'||'
'||'webserver_logging.properties'||'
'||'Next, export the new log directory using the following command:'||'
'||'export MATRIX_LOG_DIR=/DataInsight/log'||'
'||'Next, add above export entry to .bash_profile of the user to reflect the setting after reboot.'||'
'||'Finally, execute the following command to update the profile path:'||'
'||'source .bash_profile'||'
'||'
'||'
'||'7. Start the services using the following commands:'||'
'||'/opt/DataInsight/bin/DataInsightConfig start'||'
'||'/opt/DataInsight/bin/DataInsightComm start'||'
'||'/opt/DataInsight/bin/DataInsightWatchdog start'||'
'||'Note: If you had previously started these services as root, you may need to delete the following files first:'||'
'||'rm /tmp/i4jdaemon__DIdata_DataInsight_bin_DataInsightComm'||'
'||'rm /tmp/i4jdaemon__DIdata_DataInsight_bin_DataInsightWatchdog'||'
'||'rm /tmp/queryd.lock'||'
'||'rm /var/run/queryd.pid'||'
'||'
'||'
'||'8. Add following entries to /etc/rc.local to automatically start the services after reboot:'||'
'||'su – parag'||'
'||'# export MATRIX_LOG_DIR=/DataInsight/log (Optional)'||'
'||'/opt/DataInsight/bin/DataInsightConfig start'||'
'||'/opt/DataInsight/bin/DataInsightComm start'||'
'||'/opt/DataInsight/bin/DataInsightWatchdog start'||'
'||'logout'||'
'||'
'||'
'||'9. In order to stop services during shutdown, put following entries in /etc/rc.local.shutdown:'||'
'||'su – parag'||'
'||'/opt/DataInsight/bin/DataInsightConfig stop'||'
'||'/opt/DataInsight/bin/DataInsightComm stop'||'
'||'/opt/DataInsight/bin/DataInsightWatchdog stop'||'
'||'logout'||'
'||'Applying RP on Linux IndexerApplying RP on Linux IndexerApplying RP on Linux IndexerApplying RP on Linux IndexerApplying RP on Linux Indexer Applying RP on Linux IndexerApplying RP on Linux Indexer Applying RP on Linux Indexer Applying RP on Linux Indexer Applying RP on Linux Indexer Applying RP on Linux IndexerApplying RP on Linux IndexerApplying RP on Linux IndexerApplying RP on Linux IndexerApplying RP on Linux IndexerApplying RP on Linux Indexer configured with nonconfigured with nonconfigured with non configured with non configured with nonconfigured with nonconfigured with nonconfigured with nonconfigured with nonconfigured with non configured with nonconfigured with nonconfigured with non configured with non-root userroot userroot userroot userroot user root user root user'||'
'||'1. Login as specified user or switch to that user using: su – parag'||'
'||'2. Stop services using following commands:'||'
'||'/opt/DataInsight/bin/DataInsightWatchdog stop'||'
'||'/opt/DataInsight/bin/DataInsightComm stop'||'
'||'/opt/DataInsight/bin/DataInsightConfig stop'||'
'||'3. Next, login as root and install the RP package, but don''t start services.'||'
'||'4. Delete the DataInsightWatchdog service from startup:'||'
'||'chkconfig --del DataInsightWatchdog'||'
'||'5. Change the ownership of the Data insight binaries/data/logs folders back to the user you would like run the services as:'||'
'||'chown -R parag:parag /var/DataInsight'||'
'||'chown -R parag:parag /DataInsight'||'
'||'chown -R parag:parag /opt/DataInsight'||'
'||'NOTE: Change paths above as per your setup.'||'
'||'
'||'
'||'6. Switch to the user “parag” and start the services:'||'
'||'su –parag'||'
'||'# export MATRIX_LOG_DIR=/DataInsight/log (Optional)'||'
'||'/opt/DataInsight/bin/DataInsightConfig start'||'
'||'/opt/DataInsight/bin/DataInsightComm start'||'
'||'/opt/DataInsight/bin/DataInsightWatchdog start'||'
'||'
'||'
'||'Note: If services won’t start for some reason, you may need to delete the following files first:'||'
'||'rm /tmp/i4jdaemon__DIdata_DataInsight_bin_DataInsightComm'||'
'||'rm /tmp/i4jdaemon__DIdata_DataInsight_bin_DataInsightWatchdog'||'
'||'rm /tmp/queryd.lock'||'
'||'rm /var/run/queryd.pid'||'
'||'
