'||'
'||'Administering plugin registration using the PluginMgmt.bat utility'||'
'||'
'||'The PluginMgmt.bat utility helps you manage the Symantec High Availability plugin registration in your VMware environment. The utility provides options to register, unregister, and verify the registration of the plugin on the vCenter Server.'||'
'||'
'||'Symantec High Availability plugin is registered during the Symantec High Availability Console installation. Symantec recommends that you use this utility if the installer fails to register or unregister the plugin. You may need to unregister and register the plugin in cases where you wish to change the existing Symantec High Availability Console host, or if there is a change in the vCenter Web Service port.'||'
'||'
'||'After you install the Symantec High Availability Console the PluginMgmt.bat utility is available in the following directory on the Console host:'||'
'||'
'||'&lt;installdirectory&gt;\ApplicationHA\bin'||'
'||'
'||'Here, &lt;installdirectory&gt; is the directory where you install the Console, typically, C:\Program Files\Veritas.'||'
'||'
'||'To administer the plugin registration using PluginMgmt.bat'||'
'||'
'||'    From the Symantec High Availability Console host, launch the command prompt in the Run as Administrator mode and then navigate to the following directory in the command window:'||'
'||'
'||'    &lt;installdirectory&gt;\ApplicationHA\bin'||'
'||'    Type the following command to run the pluginmgmt.bat in desired mode:'||'
'||'
'||'    PluginMgmt &lt;register|unregister|verify&gt; &lt;Symantec High Availability_IP&gt;'||'	'||'&lt;vCenterServer_IP&gt;'||'	'||'&lt;vCenterServerSDK_Port&gt;'||'	'||'&lt;vCenterServer_Username&gt;'||'	'||'&lt;vCenterServer_Password&gt;'||'
'||'
'||'    The following inputs are required:'||'
'||'
'||'    register | unregister | verify'||'
'||'    '||'	'||'
'||'
'||'    Specify register to register the plugin.'||'
'||'
'||'    Specify unregister to unregister the plugin.'||'
'||'
'||'    Specify verify to validate the plugin registration.'||'
'||'
'||'    The PluginMgmt.bat utility performs these operations on the vCenter Server specified for vCenterServer_IP value.'||'
'||'
'||'    Symantec High Availability_IP'||'
'||'    '||'	'||'
'||'
'||'    If you wish to register the plugin, specify the IP address of the system where you installed the Symantec High Availability Console.'||'
'||'
'||'    If you wish to unregister or verify the plugin, specify the IP address of the system that is currently running the Symantec High Availability Console.'||'
'||'
'||'    vCenterServer_IP'||'
'||'    '||'	'||'
'||'
'||'    Specify the IP address of the vCenter Server used to manage the virtual machines.'||'
'||'
'||'    vCenterServerSDK_Port'||'
'||'    '||'	'||'
'||'
'||'    If you wish to register or verify the plugin, specify the port used by the VMware Web Service.'||'
'||'
'||'    If you wish to unregister the plugin, then specify the port that was used while registering the plugin.'||'
'||'
'||'    The default port is 443.'||'
'||'
'||'    vCenterServer_Username'||'
'||'    '||'	'||'
'||'
'||'    Specify a user account that has the vCenter Extension privileges on the vCenter Server specified for Symantec High Availability_IP value.'||'
'||'
'||'    vCenterServer_Password'||'
'||'    '||'	'||'
'||'
'||'    Specify the password of the user account specified for vCenterServer_Username value.'||'
'||'
'||'    The output of the command confirms the status of the requested operation.', '88f4264b3ad960e1ce217f850dd8e5a4', 0, '', '2efevbug', 1, 0, '', 0, 0, 0, 1, 0, '', 0);
'||'
'||'  The following procedure can be used to update the ApplicationHA Console IP address. '||'
'||'
'||'
'||'1.)'||'	'||'Unregister the ApplicationHA from vCenter'||'
'||'
'||'PS C:\Program Files\Veritas\ApplicationHA\bin&gt; .\PluginMgmt.bat unregister 192.168.10.100 192.168.10.100 443 SAMGWIN\Administrator 2fudge'||'
'||'Symantec High Availability plugin has been successfully unregistered'||'
'||'
'||'2.)'||'	'||'Change the ApplicationHA Console IP'||'
'||'
'||'3.)'||'	'||'Register the ApplicaitonHA plugin with vCenter using the new ApplicationHA Console IP'||'
'||'
'||'
'||'PS C:\Program Files\Veritas\ApplicationHA\bin&gt; .\PluginMgmt.bat register 192.168.10.125 192.168.10.100 443 SAMGWIN\Administrator 2fudge'||'
'||'Symantec High Availability plugin has been successfully registered'||'
'||'
'||'Restart the Symantec ApplicationHA Service if you have registered the Symantec High Availability plugin using a new Console host IP or vCenter Server IP.'||'
