'||'Growing a volume without growfs:'||'
'||'------------------------------------'||'
'||'
'||'To grow a UFS file system without growfs installed. Some cases may require to grow a UFS file system without using growfs. ALthough not documented in the man page mkfs will allow growing a UFS file system. The following document will assist in that scenerio.'||'
'||'
'||'
'||'Repartion your drive using free cylinders available to the drive'||'
'||'
'||'You need to determine how many blcoks are in your partition to use later with mkfs.'||'
'||'
'||'        devinfo -p /dev/rdsk/&lt;disk&gt;'||'
'||'
'||'before'||'
'||'#devinfo -p /dev/rdsk/c6t25d0s0'||'
'||'/dev/rdsk/c6t25d0s0     76      68      0       1641087 0       0'||'
'||'                                                   ^'||'
'||'                                                Blocks'||'
'||'after'||'
'||'#devinfo -p /dev/rdsk/c6t25d0s0'||'
'||'/dev/rdsk/c6t25d0s0     76      68      0       3278583 0       0'||'
'||'                                                   ^'||'
'||'#df -k'||'
'||'
'||'/dev/dsk/c6t25d0s0    771110   10258  683741     2%    /tmp/b'||'
'||'
'||'After'||'
'||'
'||'Using the number of blocks(in this case 3278583) in the'||'
'||'
'||'/usr/lib/fs/uf'||'
