'||'Global Cluster Option GCO:'||'
'||'---------------------------------------------------------------'||'
'||'
'||'Before configuring GCO you will need to install the license for Storage Foundaiton Enterprse HA/DR'||'
'||'
'||'Once the license is installed use the GCO wizzard to create the Clusterserver WAC resource'||'
'||'
'||'/opt/VRTSvcs/bin/gcoconfig '||'
'||'
'||'
'||'This will create the following in main.cf:'||'
'||'
'||'
'||'group ClusterService ('||'
'||'        SystemList = { walv240-b6g = 0, walv240-b6h = 1 }'||'
'||'        AutoStartList = { walv240-b6g, walv240-b6h }'||'
'||'        OnlineRetryLimit = 3'||'
'||'        OnlineRetryInterval = 120'||'
'||'        )'||'
'||'
'||'        Application wac ('||'
'||'                StartProgram = &quot;/opt/VRTSvcs/bin/wacstart&quot;'||'
'||'                StopProgram = &quot;/opt/VRTSvcs/bin/wacstop&quot;'||'
'||'                MonitorProcesses = { &quot;/opt/VRTSvcs/bin/wac&quot; }'||'
'||'                RestartLimit = 3'||'
'||'                )'||'
'||'
'||'        IP gcoip ('||'
'||'                Device = bge0'||'
'||'                Address = &quot;10.100.33.145&quot;'||'
'||'                NetMask = &quot;255.0.0.0&quot;'||'
'||'                )'||'
'||'
'||'        NIC csgnic ('||'
'||'                Device = bge0'||'
'||'                )'||'
'||'
'||'        gcoip requires csgnic'||'
'||'        wac requires gcoip'||'
'||'
'||'
'||'
'||'Perform the same command on both the local and remote cluster to get them ready to be joined.'||'
'||'
'||'COnnect the clusters:'||'
'||'
'||'
'||'haclus -add walv215-a1l-a1m 10.100.33.202'||'
'||'hahb -add Icmp'||'
