'||'hares -modify gcoip Address &quot;10.100.33.145&quot;'||'
'||'hares -modify gcoip NetMask &quot;255.0.0.0&quot;'||'
'||'hares -modify gcoip ArpDelay 1'||'
'||'hares -modify gcoip Enabled 1'||'
'||'hares -add csgnic NIC ClusterService'||'
'||'hares -modify csgnic Device bge0'||'
'||'hares -modify csgnic PingOptimize 1'||'
'||'hares -modify csgnic Enabled 1'||'
