'||'----------------------------------------'||'
'||'
'||'From Tech Doc:236996 '||'
'||'
'||'If the the missing EMC disks can be seen by the format then perform the following:'||'
'||'
'||'
'||'# &lt;powercf&gt; -q  (quiet mode)'||'
'||'# powermt config'||'
'||'# powervxvm setup'||'
'||'# powervxvm define'||'
'||'# powervxvm online'||'
'||'
'||'
'||'Force Linux Kernel Panic:'||'
'||'
'||'Enable the Magic SysRq key with the following command:'||'
'||'
'||'# echo 1 &gt; /proc/sys/kernel/sysrq'||'
'||'
'||'
'||'
'||'5 On the system console type:'||'
'||'Alt-SysRq-u (hold all three key down at the same time)'||'
'||'This will cause all filesystems to be re-mounted as read-only. This'||'
'||'saves the system from running fsck on all the file systems when the'||'
'||'system reboots.'||'
'||'
'||'6 On the system console type:'||'
'||'Alt-SysRq-c (hold all three key down at the same time)'||'
'||'This will force the system to panic and a crash dump to be taken. You'||'
'||'should see the following message on the console indicating stage one of'||'
'||'dump processing is occurring.'||'
'||'Dump: dumping to device xxxxxx'||'
'||'
