'||'2:48 PMVance Raywell, 2 ways'||'
'||'if the fs has not been umounted since the rm, you can:'||'
'||'echo fmtlog | /opt/VRTS/bin/fsdb /dev/vx/rdsk/DG/VOL &gt; /var/tmp/fmtlog.out'||'
'||'if it has been umounted/mounted, then the log pointers reset and fmtlog wont show much, so you need to go look at the IFLOG structural file first, find the extents, then dump those extents by:'||'
'||'echo &quot;32768b.p 1000000000 L&quot; | /opt/VRTS/bin/fsdb /dev/vx/rdsk/DG/VOL &gt; /var/tmp/logdump.out'||'
'||'assuming the IFLOG extent starts at fs block 32678'||'
'||'the IFLOG can be seen with:'||'
'||'echo 1fset.9i | /opt/VRTS/bin/fsdb /dev/vx/rdsk/DG/VOL'||'
'||'...'||'
