'||'Subject: Process for RPS creating cases in NGSC'||'
'||'
'||'Hi Team,'||'
'||'
'||'The following is how you should prepare yourself to easily open new cases for your customers.'||'
'||'
'||'1.'||'	'||'Log into Salesforce in Firefox'||'
'||'2.'||'	'||'Using a new tab, log on to RPSinfo and expand one of your accounts'||'
'||'3.'||'	'||'Find the link for the account''s Support Identifier &gt; Right-click &gt; Open in new tab'||'
'||'•'||'	'||'Since you are already logged in to Salesforce in step 1, you will not be required to log in again'||'
'||'4.'||'	'||'Sort by descending ''End Date'' so that the most recent are on top'||'
'||'5.'||'	'||'Find the entitlement that has ''ENTERPRISE VAULT'' and either ''RPS'' or ''REMOTE PRODUCT SPECIALIST'' in the Description field'||'
'||'•'||'	'||'Make sure the ''End Date'' has not past. If so, your customer does not have an active entitlement, or the SID is incorrect in RPSinfo. Either way, you need to find a valid entitlement.'||'
'||'•'||'	'||'Note my example below. The yellow is the proper one, not the red one.'||'
'||'
'||'[attachment=0:366va8jl]<!-- ia0 -->RPSCreateCase2.png<!-- ia0 -->[/attachment:366va8jl]'||'
'||'
'||'
'||' '||'
'||'6.'||'	'||'Click on the ''Entitlement Name'' for the valid RPS entitlement found in step 5 above'||'
'||'7.'||'	'||'Confirm that all of the contacts listed in RPSinfo are listed here. If not, you need to add the Salesforce contact to the entitlement '||'
'||'8.'||'	'||'Bookmark the resulting page in an ''RPS Entitlements'' folder where you can get easy access'||'
'||'9.'||'	'||'You may close this tab'||'
'||'10.'||'	'||'Go back to the tab where RPSinfo is running and repeat from step 2 for each of your accounts'||'
'||'11.'||'	'||'End of the preparation section'||'
'||'
'||'You should now have the entitlement for each of your accounts bookmarked. For the official way to open a new case from within Salesforce, please do the below (note that a 2nd easier way is currently under investigation - I will update if this comes to be):'||'
'||'
'||'1.'||'	'||'Go to your bookmark (created above)'||'
'||'2.'||'	'||'Hover over the ''Contacts'' applet and click on the individual''s name you want to create a case for'||'
'||'3.'||'	'||'Click on the ''New Case'' link'||'
'||'4.'||'	'||'Make the ''Case Type'' Technical'||'
'||'5.'||'	'||'Once you complete the ''Product name'' section, the rest of the form is easy'||'
'||'•'||'	'||'In the below example, I have highlighted what you need to set for a new case'||'
'||'•'||'	'||'TIP: In the ''Product Name'' field, type any part of a word to match a list. (example: type ''comp'' will help you to quickly find ''Enterprise Vault Compliance Accelerator'')'||'
'||'
'||'
'||'[attachment=1:366va8jl]<!-- ia1 -->RPSCreateCase.png<!-- ia1 -->[/attachment:366va8jl]'||'
'||' '||'
'||'6.'||'	'||'As before, make sure you uncheck ''Use Active Assignment Rules'' '||'
'||'
'||'Once the prep work has been done, you can open a new case in around 15 seconds.'||'
'||'
'||'Note to all: I know some of you use the ''Clone a case'' option. The intent of this is to spin off a new case from an existing active case…not to create every new case for an account. Not only is this being tracked, but any ''template master'' cases will be open for a very long time, and a certain amount of data is transferred from the originating cases (like product name, version, evidence, etc.).'||'
'||'
'||'Scott requires us to not clone from a template case since it is very easy to create a case from scratch.', 'fa952de5389e69def5ff729454939bda', 1, 'AAg=', '366va8jl', 1, 0, '', 0, 0, 0, 1, 0, '', 0);
