'||'Install the RPMs'||'
'||'
'||'#yum -y install cyrus-imapd.x86_64 cyrus-imapd-utils.x86_64 cyrus-sasl.x86_64 postfix cyrus-sasl-plain'||'
'||'
'||'Download THunderbird mail client'||'
'||'
'||'<!-- m --><a class="postlink" href="https://www.mozilla.org/en-US/thunderbird/">https://www.mozilla.org/en-US/thunderbird/</a><!-- m -->'||'
'||'
'||'
'||'Set Postfix as the mail transfer agent'||'
'||'
'||'# alternatives --config mta'||'
'||'
'||'There are 2 programs which provide ''mta''.'||'
'||'
'||'  Selection    Command'||'
'||'-----------------------------------------------'||'
'||'*+ 1           /usr/sbin/sendmail.sendmail'||'
'||'   2           /usr/sbin/sendmail.postfix'||'
'||'
'||'Enter to keep the current selection[+], or type selection number: 2'||'
'||'
'||'Enable listening on all interfaces '||'
'||'
'||'#vi /etc/postfix/main.cf'||'
'||'
'||'inet_interfaces = all'||'
'||'
'||'Cryus Config:'||'
'||'
'||'/etc/postfix/master.cf'||'
'||'
'||'Uncomment the following lines'||'
'||'
'||'cyrus     unix  -       n       n       -       -       pipe'||'
'||'  user=cyrus argv=/usr/lib/cyrus-imapd/deliver -e -r ${sender} -m ${extension} ${user}'||'
'||'
'||'add the local transport type'||'
'||'
'||'local_transport = cyrus'||'
'||'
'||'Create Cyrus User / password'||'
'||'
'||'
'||'
'||'
'||'Services:'||'
'||'
'||'# chkconfig cyrus-imapd on'||'
'||'# chkconfig saslauthd on'||'
'||'# service saslauthd start'||'
'||'# service cyrus-imapd start'||'
'||'
'||'
'||'Creating MailBox'||'
'||'
'||' '||'
'||'
'||'[root@VxArray12 yum.repos.d]# useradd support'||'
'||'[root@VxArray12 yum.repos.d]# passwd support'||'
'||'Changing password for user support.'||'
'||'New UNIX password: '||'
'||'BAD PASSWORD: it is based on a dictionary word'||'
'||'Retype new UNIX password: '||'
'||'passwd: all authentication tokens updated successfully.'||'
'||'[root@VxArray12 yum.repos.d]# saslpasswd2 support'||'
'||'Password: '||'
'||'Again (for verification): '||'
'||'
'||'# cyradm --user cyrus --auth plain localhost'||'
'||'Password: '||'
'||'IMAP Password: '||'
'||'
'||'localhost.localdomain&gt; cm user.support'||'
'||'localhost.localdomain&gt; lm'||'
'||'user.support (\HasNoChildren)  '||'
