'||'Subject: RE: QQ About NFS4 '||'
'||'
'||'No, it is not supported on Linux.'||'
'||'
'||'Checked with a developer:'||'
'||'
'||'“No, we have never supported NFSv4 on Linux. It is supported on SNAS/ISA by using NFS-Ganesha with a custom plugin rather than by using the kernel NFS server. In the past, there has been testing of NFSv4 exports using the kernel NFS server and it always ran into problems. We know what the problems are and how to fix them in a general sense, but it’s a fair amount of work and it hasn’t gotten prioritized. It’s on the preliminary list for Rufous, but it’s hard to say at this point if that will make the cut.”'||'
'||'
'||'
