'||'#!/usr/bin/perl'||'
'||'use strict;'||'
'||'use warnings;'||'
'||'my ($len, %hash,$disk, $keys,$dev);'||'
'||'
'||' for (`vxdisk list|grep -v DEVICE`){'||'
'||'  $disk = (split(/\s+/))[0];'||'
'||'    for (`vxdisk list $disk`){'||'
'||'        if(/^Device/){ $dev = (split(/\s+/))[1];'||'
'||'         next;'||'
'||'        } elsif (/^d.*k\:/){'||'
'||'          push @{$hash{(split(/\s+|=/))[4]}{''dev''}}, $dev ;'||'
'||'            }'||'
'||'        }'||'
'||' }'||'
'||'        for $keys (sort keys %hash){'||'
'||'          $len = length($keys);'||'
'||'          $len += 17;'||'
'||'          if (scalar (@{$hash{&quot;$keys&quot;}{''dev''}}) &gt;= 2 ){'||'
'||'          print &quot;\n**Duplicate IDS Found**\n\n&quot;;'||'
'||'          print &quot;ID $keys:\n&quot;;'||'
'||'           printf &quot;%${len}s\n&quot;,&quot;$_&quot; for (@{$hash{&quot;$keys&quot;}{''dev''}})'||'
'||'          }'||'
'||'        }'||'
