'||'
'||'
'||'#!/usr/bin/perl'||'
'||'use strict;'||'
'||'use warnings;'||'
'||'my ($diskgroup,@disks, %cfgrechash,@init, @type, @data);'||'
'||'my $file =  $ARGV[0];'||'
'||'    while (&lt;&gt;){'||'
'||'     chomp;'||'
'||'       if (/^[a-z]/) {'||'
'||'       @type = split(/\s+/);'||'
'||'           $diskgroup = $type[1] if ((/^dg/)&amp;&amp;(defined $type[1]));'||'
'||'           next;'||'
'||'        } elsif (! /^[a-z]/) {'||'
'||'           @data = split(/\=/);'||'
'||'           $data[0] =~ s/\s+// if (defined $data[0]);'||'
'||'           $data[1] =~ s/\&quot;// if (defined $data[1]);'||'
'||'               }'||'
'||'     $cfgrechash{$diskgroup}{$type[0]}{$type[1]}{$data[0]} = $data[1] if (defined $type[1] &amp;&amp; defined $data[1]);'||'
'||'    }'||'
'||'
'||'    for my $keys (keys %cfgrechash){'||'
'||'      push (@disks, &quot;vxdg init $keys &quot;);'||'
'||'      for my $values (keys %{$cfgrechash{$keys}{''dm''}}){'||'
'||'         if ( $cfgrechash{$diskgroup}{''dg''}{$diskgroup}{''cds''} =~ /off/){'||'
'||'        push @init, &quot;vxdisk -f init &quot; . $cfgrechash{$keys}{''dm''}{$values}{''last_da_name''} .&quot; &quot;.'||'
'||'                       &quot;privoffset=&quot; . $cfgrechash{$keys}{''dm''}{$values}{''priv_offset''} .&quot; &quot;.'||'
'||'                       &quot;privlen=&quot; . $cfgrechash{$keys}{''dm''}{$values}{''priv_len''} .&quot; &quot;.'||'
'||'                       &quot;puboffset=&quot; . $cfgrechash{$keys}{''dm''}{$values}{''pub_offset''} .&quot; &quot;.'||'
'||'                       &quot;publen=&quot; . $cfgrechash{$keys}{''dm''}{$values}{''pub_len''} . &quot; format=sliced\n\n&quot; if (defined $cfgrechash{$keys}{''dm''}{$values}{''priv_offset''}) ;'||'
'||'                     } else {'||'
'||'        push @init, &quot;vxdisk -f init &quot; . $cfgrechash{$keys}{''dm''}{$values}{''last_da_name''} .&quot; &quot;.'||'
'||'                       &quot;privoffset=&quot; . $cfgrechash{$keys}{''dm''}{$values}{''priv_offset''} .&quot; &quot;.'||'
'||'                       &quot;privlen=&quot; . $cfgrechash{$keys}{''dm''}{$values}{''priv_len''} .&quot; &quot;.'||'
'||'                       &quot;puboffset=&quot; . $cfgrechash{$keys}{''dm''}{$values}{''pub_offset''} .&quot; &quot;.'||'
'||'                       &quot;publen=&quot; . $cfgrechash{$keys}{''dm''}{$values}{''pub_len''} . &quot;\n\n&quot; if (defined $cfgrechash{$keys}{''dm''}{$values}{''priv_offset''}) ;'||'
'||'                     } '||'
'||'        push @disks, &quot;$values=&quot; . $cfgrechash{$keys}{''dm''}{$values}{''last_da_name''};'||'
'||'        }'||'
'||'      }'||'
'||'        push @disks, &quot;cds=off&quot; if ( $cfgrechash{$diskgroup}{''dg''}{$diskgroup}{''cds''} =~ /off/);'||'
'||'      print &quot;\n\nRebuild Commands Below&quot; . &quot;\n&quot; . &quot;-------------------------&quot; . &quot;\n&quot;;'||'
'||'      for (@init){'||'
'||'        print &quot;$_&quot;;'||'
'||'      }'||'
'||'      print &quot;\n@disks\n\n&quot;;'||'
'||'      print &quot;cat $file |grep -v dgfail|vxprint -D - -mvphsr &gt; vxmake.out\n\n&quot;;'||'
'||'      print &quot;vxmake -g $diskgroup -d vxmake.out\n\n&quot;;'||'
