'||'sub list_hosts {'||'
'||'    # get the hosts on which import at ran successfuly'||'
'||'    if ($cms_info-&gt;{cs} != 1 )'||'
'||'    {'||'
'||'        print &quot;List option is available only on MS.\n&quot;;'||'
'||'        exit(0);'||'
'||'    }'||'
'||'
'||'    my $db_query = &quot;select TARGET from habdbsync.P_SF_TASK where Name like'||'
'||'    \''Import AT\'' AND error = 0&quot;;'||'
'||'    my @db_hosts;'||'
'||'    my @domain_hosts;'||'
'||'    my $result = VRTS::Util::exec_sql_command($db_query);'||'
'||'    foreach my $tuple (@{$result-&gt;{Records}}){'||'
'||'        push @db_hosts, $tuple-&gt;{''TARGET''};'||'
'||'    }'||'
'||'    my $enum_cmd = VRTS::Util::make_command ($xprtlc, &quot;-l&quot;, &quot;https://$cms_info-&gt;{cs_name}/agent/domain/enum&quot;);'||'
'||'    my $h;'||'
'||'    if (open ($h, &quot;$enum_cmd |&quot;) == 0)'||'
'||'    {'||'
'||'        VRTS::Logger::log(''error'',&quot;Failed to get the list of host from domain.conf&quot;);'||'
'||'        exit(1);'||'
'||'    }'||'
'||'    while (&lt;$h&gt;)'||'
'||'    {'||'
'||'        chomp;'||'
'||'        my @cols = split ('','');'||'
'||'        push @domain_hosts,$cols[0];'||'
'||'    }'||'
'||'    my %list= ();'||'
'||'    print &quot;$_\n&quot; for(@db_hosts);'||'
'||'    my @hosts= ();'||'
'||'    map{$list{$_}++} @domain_hosts, @db_hosts;'||'
'||'    @hosts = grep {$list{$_} ==1 } keys (%list);'||'
'||'    print &quot;List of hosts which are on 1024.\n &quot;;'||'
'||'    print (Dumper (\@hosts));'||'
