'||'The following are some notes that may help you clone the LVM rootdisk.'||'
'||'<!-- m --><a class="postlink" href="http://support.veritas.com/docs/250801">http://support.veritas.com/docs/250801</a><!-- m -->'||'
'||'<!-- m --><a class="postlink" href="http://support.veritas.com/docs/261967">http://support.veritas.com/docs/261967</a><!-- m -->'||'
'||'==========================================================================='||'
'||'Ways to initialize the disk to bring it under VxVM and clone the root disk:'||'
'||'(1) Initialize the VxVM with vxinstall and add a blank disk to the rootdg. After this you then run vxcp_lvmroot to clone the root disk.'||'
'||'(2) Use vxcp_lvmroot without invoking vxinstall'||'
'||'In this procedure, use vxcp_lvmroot utility instead to clone root disk for rootability. The vxcp_lvmroot command copies (or &quot;clones&quot;) the volumes associated with an LVM root volume group to volumes of equal size (unless the -R option is specified) on a VxVM root disk group. VxVM rootability means that VxVM controls the disk containing the root file system. The vxcp_lvmroot command provides a means of achieving VxVM rootability when upgrading from a prior release of HP-UX without having to use Ignite_UX to perform a cold install. Check the man pages for more info.'||'
'||'# /etc/vx/bin/vxcp_lvmroot -v c0t1d0'||'
'||'After cloning the bootdisk, mirror it using the following command'||'
'||'# /etc/vx/bin/vxrootmir -v c0t2d0'||'
