'||'Destroy and restore the disk from VXVM root disk to LVM disk use vxdestroy_lvmroot and &lt;vxres_lvmroot&gt; utilities. '||'
'||'The vxdestroy_lvmroot tears down and removes the LVM volume group associated with the specified physical disk. '||'
'||'This is done by removing the volumes in the volume group and then removing the volume group. The &lt;vxres_lvmroot&gt; '||'
'||'restore LVM root disk from VERITAS Volume Manager root disk '||'
'||'
'||'# /etc/vx/bin/vxdestroy_lvmroot -v c0t0d0'||'
'||'Note: Check and change boot prompt using setboot utility and make sure that the system is not booted from c0t0d0. '||'
'||'The script will fail if the disk is being used. '||'
