'||'                Block Device $BLOCKDEVICE : MountPoint $MOUNTPOINT&quot; \'||'
'||'                5502 &quot;$MOUNTOPT&quot; &quot;$BLOCKDEVICE&quot; &quot;$MOUNTPOINT&quot;'||'
