'||'        ERROR=`cat $RES_ERROR_FILE`'||'
'||'        VCSAG_LOG_MSG2 &quot;W&quot; &quot;Mount Error : $ERROR&quot; 5508 &quot;$ERROR&quot;'||'
'||'        rm -f $TMOFILE &gt; /dev/null 2&gt;&amp;1'||'
'||'        exit 0'||'
