'||'Installation fails with the following error. '||'
'||'
'||'[i:3kuo30pc][root@server101 NetBackup_7.7.3_LinuxR_x86_64]# /usr/openv/netbackup/bin/cluster/cluster_config -isNBClustered -vname nbuserver.SAMG.local'||'
'||'server101  DR_RHEL7:drserver201 DR_RHEL7:drserver202 localclus:server101 localclus:server102 nodes are not ssh equivalent'||'
'||'Passwordless SSH is not configured between cluster nodes'||'
'||'It is recommended to use SSH for secure communication'||'
'||'Do you want to use RSH instead? [y,n] (n) [/i:3kuo30pc]'||'
'||'
'||'COMPLETED:'||'
'||'=================================='||'
'||'
'||'Located problem code'||'
'||'
'||'/usr/openv/netbackup/bin/cluster/init_common'||'
'||'
'||'
'||'NODES=&quot;&quot;'||'
'||'        if [ &quot;${CLUTYPE}&quot; = &quot;VCS&quot; ] ; then'||'
'||'                NODES=`/opt/VRTSvcs/bin/hasys -list`'||'
'||'
'||'The problem is when the cluster is configured with GCO the hasys command includes the cluster names. '||'
'||'
'||'[root@server101 ~]# hasys -list'||'
'||'DR_RHEL7:drserver201'||'
'||'DR_RHEL7:drserver202'||'
'||'localclus:server101'||'
'||'localclus:server102'||'
'||'
'||'Without GCO'||'
'||'
'||'[root@server101 ~]# hasys -list'||'
'||'server101'||'
'||'server102'||'
'||'
'||'SOLUTION:'||'
'||'=========================='||'
'||'
'||'Update the /usr/openv/netbackup/bin/cluster/init_common script to include a gawk statement. '||'
'||'
'||'199         if [ &quot;${CLUTYPE}&quot; = &quot;VCS&quot; ] ; then'||'
'||'200                 NODES=`/opt/VRTSvcs/bin/hasys -list|gawk -F\: ''{print $2}''`'||'
'||'201         elif [ &quot;${CLUTYPE}&quot; = &quot;HPSG&quot; ] ; then', '469cd4a49e1fbd4b44ad8292f2395a07', 0, 'IA==', '3kuo30pc', 1, 0, '', 0, 0, 0, 1, 0, '', 0);
