'||'============================'||'
'||'- The customer would like to have the storage for ViOM located on a CFS filesystem. This will allow the customer to see how CFS works in a production environment.'||'
'||'
'||'COMPLETED:'||'
'||'============================'||'
'||'- Configured ViOM using CFS'||'
'||'
'||'1.) Installed ViOM on both cluster nodes server101 &amp; server102'||'
'||'
'||'2.) Configured standalone ViOM server on server101 using virtual name vom.SAMG.local'||'
'||'
'||'3.) Added server102 as a managed host'||'
'||'
'||'4.) Created the required service groups in VCS for VOM HA.'||'
'||'
'||'
'||'group SFM_SStore ('||'
'||'SystemList = { server101 = 0, server102 = 1 }'||'
'||'AutoStartList = { server101 }'||'
'||')'||'
'||'
'||'DiskGroup SFM_SStore_DG ('||'
'||'DiskGroup = vomdg'||'
'||')'||'
'||'
'||'
'||'
'||'group SFM_Services ('||'
'||'SystemList = { server101 = 0, server102 = 1 }'||'
'||'AutoStartList = { server101 }'||'
'||')'||'
'||'
'||'
'||'IP SFM_Services_IP ('||'
'||'Device = ens33'||'
'||'Address = &quot;192.168.10.141&quot;'||'
'||'NetMask = &quot;255.255.255.0&quot;'||'
'||')'||'
'||'
'||'Mount SFM_Services_Mount ('||'
'||'MountPoint = &quot;/vomdb&quot;'||'
'||'FSType = vxfs'||'
'||'BlockDevice = &quot;/dev/vx/dsk/vomdg/vomdb&quot;'||'
'||'FsckOpt = &quot;-y&quot;'||'
'||')'||'
'||'
'||'NIC SFM_Services_NIC ('||'
'||'Device = ens33'||'
'||')'||'
'||'
'||'5.) Configured ViOM'||'
'||'
'||'<!-- m --><a class="postlink" href="https://vom.SAMG.local:5634">https://vom.SAMG.local:5634</a><!-- m -->'||'
'||'
