'||'Unpublishing technote'||'
'||'########################################################################################################'||'
'||'
'||'
'||'
'||'During a VERITAS Cluster Server (VCS) upgrade or patch install procedure, systems will encounter ''device busy'' when trying to modunload gab when VERITAS File System (VxFS) 3.4 is installed on the system.  This is due to VxFS calls to the gab application program interface (api) that were added into VxFS for VERITAS Cluster File System (CFS).'||'
'||'This affects systems even if a CFS license is not present.  Modifications are being made in future releases of VxFS to resolve this.'||'
'||'
'||'Verify the VxFS version using:'||'
'||'
'||'#pkginfo -l VRTSvxfs'||'
'||'
'||'    PKGINST:  VRTSvxfs'||'
'||'        NAME:  VERITAS File System'||'
'||'CATEGORY:  system,utilities'||'
'||'         ARCH:  sparc'||'
'||'   VERSION:  3.4,REV=GA03'||'
'||'   BASEDIR:  /'||'
'||'    VENDOR:  VERITAS Software'||'
'||'         DESC:  Commercial File System'||'
'||'    PSTAMP:  VERITAS-3.4FS-2000-11-21'||'
'||'  INSTDATE:  May 01 2001 13:04'||'
'||'    HOTLINE:  (800) 342-0652'||'
'||'        EMAIL:  <!-- e --><a href="mailto:support@veritas.com">support@veritas.com</a><!-- e -->'||'
'||'     STATUS:  completely installed'||'
'||'         FILES:    172 installed pathnames'||'
'||'               20 shared pathnames'||'
'||'                 5 linked files'||'
'||'               32 directories'||'
'||'               48 executables'||'
'||'                 5 setuid/setgid executables'||'
'||'          11089 blocks used (approx)'||'
'||'
'||'The workaround is as follows:'||'
'||'
'||'First, ensure all VxFS file systems are not mounted.'||'
'||'
'||'#mount'||'
'||'/proc on /proc read/write/setuid on Wed May 16 13:37:58 2001'||'
'||'/ on /dev/vx/dsk/rootvol read/write/setuid/largefiles on Wed May 16 13:37:58 2001'||'
'||'/usr on /dev/vx/dsk/usr read/write/setuid/largefiles on Wed May 16 13:37:58 2001'||'
'||'/tmp on swap read/write/setuid on Wed May 16 13:38:17 2001'||'
'||'
'||'
'||'Second, the VxQIO (fdd) module must be unloaded.  Because the fdd module could get unloaded to free up memory by the operating system, it is necessary to set fdd as not unloadable. Therefore; to ensure it stays in memory, a global variable &quot;vxfdd_nounload&quot; is set to &quot;1&quot; or true. Thus, vxfdd_nounload must be set to &quot;0&quot; or false for the unload of the fdd module to succeed.'||'
'||'# echo &quot;vxfdd_nounload/D&quot; | adb -k'||'
'||'physmem bbf36'||'
'||'vxfdd_nounload:'||'
'||'vxfdd_nounload: 1'||'
'||'# modinfo | grep fdd'||'
'||'74 72b07000 29d8 134 1 fdd (VxQIO 3.4,REV=GA03 Quick I/O dr)'||'
'||'# modunload -i 74'||'
'||'can''t unload the module: Device busy'||'
'||'# echo &quot;vxfdd_nounload/W 0&quot; | adb -kw'||'
'||'physmem bbf36'||'
'||'vxfdd_nounload: 0x1                =    0x0'||'
'||'# modunload -i 74'||'
'||'
'||'Third, the VxFS module can now be unloaded.'||'
'||'# modinfo | grep vxfs'||'
'||'82 5387a000 83ef4 8 1 vxfs (VxFS 3.4,REV=GA03 (SunOS 5.7))'||'
'||'# modunload -i 82'||'
'||'
'||'Fourth, with fdd and VxFS modules unloaded,  it is now possible to unload the gab module.  See the upgrade or patch procedures to continue.'||'
'||'Finally after the upgrade or patch, mounting a VxFS file system will automatically reload the VxFS and fdd modules.', '711ed87879f1bcb452b805fb16f0a873', 0, '', '243p7isk', 1, 0, '', 0, 0, 0, 1, 0, '', 0);
