'||'Subject: QQ: The script showversion and DNS'||'
'||'
'||'Hi STORAGE ONCALL,'||'
'||'
'||'Is DNS a requirement for the patch download process when using showversion?'||'
'||'
'||'When running /opt/VRTS/install/showversion on a server with DNS configured, we are able '||'
'||'to properly list the versions of VRTS packages installed on the server and download the available'||'
'||'patches for the installed version of sfha.'||'
'||'
'||'When running /opt/VRTS/install/showversion on a server where DNS is not configured we get '||'
'||'The following error:'||'
'||'
'||'CPI WARNING V-9-30-2323 The version checker cannot connect to the SORT website.'||'
'||'Due to lack of access to release matrix files on the SORT website, the results'||'
'||'returned from the version checker may not be up to date.'||'
'||'
'||'However, when we run /opt/VRTS/install/showversion ServerIP:  We get the version of software installed but we are '||'
'||'not able to  download the available patches:   We get error: '||'
'||'
'||'CPI WARNING V-9-30-2323 The version checker cannot connect to the SORT website.'||'
'||'Due to lack of access to release matrix files on the SORT website, the results'||'
'||'returned from the version checker may not be up to date.'||'
'||'
'||'Do you want to continue? [y,n,q]  y'||'
'||'
'||'    Checking communication on 10.92.178.11 .......................... Failed'||'
'||'
'||'
'||'Our customer uses a proxy server to access the internet and would like to use showversions to '||'
'||'periodically check and download any available Veritas patches.'||'
'||'
'||'Is there a CLI to download available patches from sort using a proxy server? '||'
'||'
